import * as React from "react";
import { Row, Col, Input, DatePicker, Button } from "antd";
import { RouteComponentProps } from "@reach/router";

type nuovaCampagna = {
  nomeCampagna: String;
  dataInizio: Date;
  dataFine: Date;
  profiloCampagna: "Global Campain";
  note: String;
  Campagna: String;
}[];

interface Props extends RouteComponentProps {
  dataForm: nuovaCampagna;
  onChangeInput: {};
}

export const NuovaCampagna: React.FC<Props> = (dataForm, onChangeInput) => {
  return (
    <div style={{ paddingLeft: 80, paddingTop: 50, paddingRight: 80 }}>
      <br></br>
      <Row>
        <Col span={6}>Nome Campagna</Col>
        <Col span={6}>
          <Input
            name="nomeCampagna"
            placeholder=""
            // value={dataForm.nomeCampagna}
            onChange={onChangeInput}
          />
        </Col>
      </Row>
      <br></br>
    </div>
  );
};
